    <UserListFrame />
    <PracticeFrame1 />
    <Hook2 />
    <Counter01 />
    <Hook3 />
    <Counter02/>
    <Hook4 />
    <Record personal= {{name:"tatsuki",age:60,mail:"tatsuki@gmail.com"}}/>
    <Hook5/>
    <Counter03/>
  </React.StrictMode>
);

